import { Component } from '@angular/core';

@Component({
  selector: 'app-navbarc',
  templateUrl: './navbarc.component.html',
  styleUrls: ['./navbarc.component.css']
})
export class NavbarcComponent {

}
<nav class="navbar navbar-expand-lg bg-body-tertiary"  >
    <div class="container-fluid" style="color: blue;" style="background-color: black;">
      <a class="navbar-brand" href="#"> <img src="../../../assets/images/menubar.png" height="10" width="10"><img src="../../../assets/images/flight.png" height="100" width="100">  <span style="color:white">Abhi Travels</span> </a>
      <button class="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
        <span class="navbar-toggler-icon"></span>
      </button>

            <div class="g-col-6" style="color: white;">Register With us</div>
            <div class="g-col-4" style="color: white;"><button style="border-radius: 5px;border-color:white">Customer Reviews</button></div>

      </div> 
  </nav>
